import React from 'react';

const Details = ({details}) => {
    console.log(details);
    const {Title, Year, Genre, Poster, imdbRating} = details;
    return (
        <div className="row">
            <div className="col l2 hide-on-med-and-down"></div>
            <div className="col l8 m12 s12">
                Details
            </div>
            <div className="col l2 hide-on-med-and-down"></div>
        </div>
    )
}

export default Details;
